{parent.find('.wd_captcha_img').attr('src',parent.find('.wd_captcha_img').attr('src').split("&")[0]+'&post_id='+parent.find('.contact_id').val()+'&r='+Math.floor(Math.random()*100));parent.find('.message_capcode').val('');}
